import React from "react"


class VideoItem extends React.Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <div className="item">
                <img
                    src={this.props.video.snippet.thumbnails.default.url}
                    className="item">
                </img>
                <p className="item">{this.props.video.snippet.title}</p>
            </div>)
    }
}


export default VideoItem
